window.bookSummaryJSON = "<p>Elle Chambers, enchantress and investigator, is ready for a break. A romantic trip to the Outer Hebrides sounds perfect, but a new case disrupts everything. A cursed harp, a music witch tormented by a jealous wyvern, and a string of dead lovers draw Elle and her team into one of their strangest investigations yet.</p><p>The creature clings to the harp and to the witch who plays it, feeding on her magic and turning deadly toward anyone who gets too close.</p><p>As Elle, Fergie, and their allies dig into the origins of the curse, they uncover a dangerous cycle of possession and obsession. Worse still, Elle must find a way to confront the wyvern using a part of herself she barely understands: her dragon nature.</p><p>With a handfasting on the horizon, old rivalries resurfacing, and secrets threatening to fracture fragile alliances, Elle must once again walk the line between personal loyalty and professional duty. This time, the cost of failure could be deadly for everyone she loves.</p><p><i>What You Witch</i> blends mystery, magic, and danger in a thrilling continuation of The Witch Detectives series.</p><p><b>Click BUY NOW or READ FOR FREE with Kindle Unlimited and dive deeper into Elleâ€™s next magical mystery.</b></p>"; 
